using namespace std;

class Solution {
public:
    int sizeOfSet(int index,vector<int>&nums,vector<bool>&visited){
        int size = 0;
        while(!visited[index]){
            visited[index] = true;
            index = nums[index];
            size++;
        }
        return size;
    }
    
    int arrayNesting(vector<int>& nums) {
        int largestSetSize=0;
        int n = nums.size();
        vector<bool>visited(n,false);
        for(int i=0;i<n;i++){
            largestSetSize = max(largestSetSize , sizeOfSet(i,nums,visited));
        }
        return largestSetSize;
    }
};

